import React from "react";
import './SingleProduct.css'
import { Link } from "react-router-dom";


function SingleProduct({item}){

    return(
        <>
        {/* <h1>This is SingleProduct Item</h1> */}
          <div className="Single-Product col-lg-3 col-md-6 col-6 animate-card">
            <div className="item-brand productlist custom-full-border productCard">
             <h1>{item.brand}</h1> 
             
               <Link to=""></Link>
              <span>{item.category}
                {item.color}</span>  
            
             {/* <p>{item.description}</p> */}

            <div className="imgBlock custom-border listhover" style={{innerHeight:"330px",backgroundColor:"rgb(255,235,231)"}}>

            </div>
             <span className="item-img">
                <img src={item.displayImage} alt="item-image"/>
             </span>
             </div>
             <span className="item-type">{item.fabric}</span>
             <span className="item-gender">{item.gender}</span>
             <span className="item-Name">{item.name}</span>
             <span className="item-price">{item.price}</span>
             <span className="item-rating">{item.ratings}</span>
             <span className="item-seller">{item.seller.name}</span>
             <span className="item-seller-teg">{item.sellerTag}</span>
             <span className="item-seller-subCategory">{item.subCategory}</span>
             <span className="item-seller-teg">{item.tags.type}</span>
             <span className="item-seller-teg">{item.tags.label}</span>
             <span className="item-seller-teg">{item.type}</span>
          </div>
        </>
        
    );
}

export default SingleProduct;
